// Import Link from react-router-dom
import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Sidebar.module.css'; // Assuming you have a CSS module for styling

const Sidebar = () => {
    return (
        <aside className={styles.sidebar}>
            <Link to="components/main/main.html" className={styles.link}>Main</Link>
            <Link to="components/about/about" className={styles.link}>About</Link>
            <Link to="components/settings/settings" className={styles.link}>Settings</Link>
            {/* Add other navigation links as needed */}
        </aside>
    );
};

export default Sidebar;
